import { useState } from "react";
const courses = [
    {
        id: 1,
        name: 'HTML,CSS'
    },
    {
        id: 2,
        name: 'JavaScript'
    },
    {
        id: 3,
        name: 'ReactJS'
    }
]
function TwoWayBinding() {
    return (
        <>
            {courses.map(cour => {
                <div key={cour.id}>{cour.name}</div>
            })}
        </>
    )
}
export default TwoWayBinding;
